window.bookSummaryJSON = "<p>Creatures of all kinds go to the Barista to find love, including the ancient tentacled demon known as Meduso.</p> <p>After centuries of being alone, Meduso calls on a favor from his old friend the Barista. He can feel that his mate is close, but can’t seem to find him without a little help.</p> <p>The Barista begrudgingly pairs Meduso up with a human named Noah. After the first date, it’s clear to Meduso that Noah will be his, whether he wants to be or not.</p> <p>Noah has known about monsters his entire life, but he’s never met one so dark, twisted, and demented.</p> <p>When danger and betrayal arise, the fragile trust the two have built becomes the only thing that can save them. Even with the fear of giving away their hearts, these two find themselves tumbling headfirst into a passion that will burn everything in their path—even the devil himself.</p> <p>This novella has the following:</p> <ul> <li>Hot monster scenes.</li> <li>Tentacles.</li> <li>Special electrical package….</li> <li>Fated mates love.</li> <li>Voyeur.</li> <li>Sword crossing.</li> </ul> <p>And more ;)</p> <p>The Creature Cafe Series follows the Barista and whom he matchmakes. Each book will have a different monster finding their true love, tons of spicy scenes, and special *ahem* appendages.</p>"; 
